script: |
  super -f tsv -I q9353.sql | sort > q9353.out

inputs:
  - name: q9353.sql
    data: |
      SELECT ALL + CAST ( - col0 AS INTEGER ) / col1 col2, 95 AS col0 FROM tab0 WHERE + col2 NOT BETWEEN 57 AND - - col1 + col0;
  - name: tab0

outputs:
  - name: q9353.out
    data: |
      -4	95
      -97	95
      0	95
